import React from "react";
import Motor3d from "../generalLayout/motor3d";
import PageName from "../generalLayout/pageName";
import MotorPageHeader from "../generalLayout/motorPageHeader";
import MotorSlideImg from "../generalLayout/motorSlideImg";
import { ScrollNavFunction } from "../generalFunctionForOnScroll/ScrollEventFor_MotorPage";
import { FooterGe } from "../generalLayout/footer_test";
import MvEmail from "../generalLayout/mvEmail";
import { NavWhiteCompact } from "../generalFunctionForOnScroll/ScrollEventFor_Homepage";
import Nav from "../generalLayout/nav";
import NavDesktop from "../generalLayout/navDesk";
const namePage = "Dragster 800 Rosso";
const nameHeaderTitle = "dragster800rosso/dragster-800-rosso.svg";
const manifesto_Arr = ["YOUR", "DREAM", "STARTS", "HERE"];
const heroGradientStart = "#252524";
const heroGradientEnd = "#222121";
const colorBg = `linear-gradient(90deg,${heroGradientStart} 0%,${heroGradientEnd} 100%)`;
const contentHeaderContent =
  "All the guts, the power and the character of a true Dragster. Accessible, pure riding pleasure.";
const price = "12.990";
const imgSlideSrc = [
  "img/dragster800rosso/1.jpg",
  "img/dragster800rosso/2.jpg",
  "img/dragster800rosso/3.jpg",
  "img/dragster800rosso/4.jpg",
  "img/dragster800rosso/5.jpg",
  "img/dragster800rosso/6.jpg",
];
const listImgs = [
  {
    contentTitle: "OVER 300 KM/H",
    img: "rush1000/rush1.jpg",
    content:
      "With a top speed of over 300 km/h, the Rush imposes its pace also thanks to the impressive performance of a replica MotoGP. Thanks to its “launch control” system and traction control, it takes no prisoners when it comes to acceleration, its true talent, and can stand up to the meanest superbikes.",
  },
  {
    contentTitle: "208 HP FOR COMPLETE DOMINATION",
    img: "rush1000/rush2.jpg",
    content:
      "The inline-four-cylinder engine of the Brutale 1000RR, the result of an accurate development process, offers record power of 208 hp (153 kW) at 13000 rpm, that further increases to 212 hp (156 kW) in racetrack configuration. Torque stands at 116.5 Nm. The combustion chamber has been completely redesigned, drawing on Formula 1 technology.",
  },
  {
    contentTitle: "TRACTION CONTROL FOR LIGHTING LAUNCHES",
    img: "rush1000/rush3.jpg",
    content:
      "The evolution of the electronics compartment aims at making the Rush the easiest possible to drive despite its exceptional performance. Thus the extreme care in fine-tuning the electronic management of the engine. The 8-level traction control is particularly useful on a model boasting rocket-like starts, as is the anti-wheelie system and the EAS 2.1 Up & Down for clutch-free changes.",
  },
  {
    contentTitle: "SAFETY",
    img: "rush1000/rush4.jpg",
    content:
      "Brembo Stylema callipers linked to Bosch 9 Plus Race ABS with RLM (Rear wheel Lift Mitigation) constitute the ideal combination to manage the exuberance of the Rush. Born to impress, it can exploit the Öhlins EC suspension units with electronic adjustment system to further enhance driving control.",
  },
];
export default function Dragster800Rosso() {
  window.addEventListener("scroll", () => {
    ScrollNavFunction();
    NavWhiteCompact();
  });
  return (
    <>
      <div
        className="nav-pc-homepage"
        style={{
          height: "84px",
          width: "100vw",
          background: colorBg,
        }}
      ></div>
      <NavDesktop />
      <Nav color="white" />
      <PageName namePage={namePage}></PageName>
      <MotorPageHeader
        manifesto_Arr={manifesto_Arr}
        nameHeaderTitle={nameHeaderTitle}
        titleSize="auto 18%"
        colorBg={colorBg}
        contentHeaderContent={contentHeaderContent}
        price={price}
        bgHeaderParallax="dragster800rosso/dragster-800-rosso-xl.png"
        reveredContent={false}
        heightContentTop= "14.5%"
      />
      <Motor3d
        imgLocate="dragster800rosso/dragster800rosso"
        nameModel="MV AGUSTA DRAGSTER 800 ROSSO"
        price={price}
      />
      {/* <br />
      <Motor3dBodyTech listImgs={listImgs} /> */}
      <br />
      <br />
      <MotorSlideImg imgSlideSrc={imgSlideSrc} />
      <br></br>
      <br></br>
      <MvEmail></MvEmail>
      <br />
      <FooterGe />
    </>
  );
}
